import React, { Component } from "react";

export default class Body extends Component {
  render() {
    const style = {
      marginTop: "200px"
    };

    return (
      <div>
        <img style={style} src={require("../images/mother.png")} />
        <img style={style} src={require("../images/bluehour.png")} />
        <img style={style} src={require("../images/curse.png")} />
        <img style={style} src={require("../images/pitbulls.png")} />
        <img style={style} src={require("../images/killerKids.png")} />
        <img style={style} src={require("../images/nightwatch.png")} />
        <img style={style} src={require("../images/allSummer.png")} />
        <img style={style} src={require("../images/winter.png")} />
      </div>
    );
  }
}
